import React from 'react'

function Results({ items, onItem, onFav, favs }) {
    return <ul>
        {
            items.map(({ id, title, image, price }) =>{
                const isFav = favs.some(fav => fav.id === id)

                return <li key={id} onClick={() => onItem(id)}>
                    <h2>{title}</h2>
                    <img src={image} />
                    <span>{price}</span>
                </li>
            })
        }
    </ul>
}

export default Results
